import { createSlice } from "@reduxjs/toolkit";

const initialState = {
  id: null,
  title: null,
  amount: null,
  date: null,
};
const ExpencesSlice = createSlice({
  name: "Expences",
  initialState,
  reducers: {
    add(expence) {},
    filter(year) {},
  },
});

export const AddExpence = () => {
  // const ctx = useContext(AuthContext);
  // debugger
  return async () => {
    // console.log(ctx.email);
    await fetch(
      `https://expencetracker-b3897-default-rtdb.firebaseio.com/users.json`,
      {
        method: "put",
        body: JSON.stringify({
          email: localStorage.getItem("email"),
        }),
        headers: {
          "Content-Type": "Application/Json",
        },
      }
    );
    debugger;
  };
};

export default ExpencesSlice;
